import React from 'react';

function DisplayMovie(props) {
    return (
      <div className="rank-rows">
        <h1>{movie.rank}</h1>
        <img src={props.movie.Poster} alt='movie' className='movie-image'></img>
        
      </div>
    )
}

export default DisplayMovie;
